define({"topics" : [{"title":"Prerequisites","href":"datacollector\/UserGuide\/Destinations\/Bigtable.html#concept_f5v_11l_1y","attributes": {"data-id":"concept_f5v_11l_1y",},"menu": {"hasChildren":true,},"tocID":"concept_f5v_11l_1y-d46e148284","next":"concept_f5v_11l_1y-d46e148284",},{"title":"Row Key","shortdesc":"\n               <p class=\"shortdesc\">Each Google Cloud Bigtable table has one index, the row key. When you configure the         Google Bigtable destination, you\n                  define which field or fields in the record to use as the         row key. \n               </p>\n            ","href":"datacollector\/UserGuide\/Destinations\/Bigtable.html#concept_asz_2gl_1y","attributes": {"data-id":"concept_asz_2gl_1y",},"menu": {"hasChildren":false,},"tocID":"concept_asz_2gl_1y-d46e148386","topics":[]},{"title":"Cloud Bigtable Data Types","shortdesc":"\n               <p class=\"shortdesc\">When you map record fields to Google Cloud Bigtable columns, you specify whether the         Cloud Bigtable storage type is\n                  text or binary. The destination converts the data types of         the record fields to the Cloud Bigtable storage types.\n                  \n               </p>\n            ","href":"datacollector\/UserGuide\/Destinations\/Bigtable.html#concept_gph_lm4_cy","attributes": {"data-id":"concept_gph_lm4_cy",},"menu": {"hasChildren":false,},"tocID":"concept_gph_lm4_cy-d46e148441","topics":[]},{"title":"Column Family and Field Mappings","shortdesc":"\n               <p class=\"shortdesc\">When you configure the Google Bigtable destination, you map record fields to Google         Cloud Bigtable columns. You define\n                  the Cloud Bigtable columns to write to by defining the         column family and column qualifier.\n               </p>\n            ","href":"datacollector\/UserGuide\/Destinations\/Bigtable.html#concept_sbp_vz4_1y","attributes": {"data-id":"concept_sbp_vz4_1y",},"menu": {"hasChildren":false,},"tocID":"concept_sbp_vz4_1y-d46e148507","topics":[]},{"title":"Time Basis","shortdesc":"\n               <p class=\"shortdesc\">The time basis determines the timestamp value added for each column written to Google         Cloud Bigtable. </p>\n            ","href":"datacollector\/UserGuide\/Destinations\/Bigtable.html#concept_vwy_334_1y","attributes": {"data-id":"concept_vwy_334_1y",},"menu": {"hasChildren":false,},"tocID":"concept_vwy_334_1y-d46e148583","topics":[]},{"title":"Configuring a Google Bigtable Destination","href":"datacollector\/UserGuide\/Destinations\/Bigtable.html#task_op4_zmq_tx","attributes": {"data-id":"task_op4_zmq_tx",},"menu": {"hasChildren":false,},"tocID":"task_op4_zmq_tx-d46e148669","topics":[]}]});